import words from "../../images/33words.jpg"

function MoviesCardList() {
    return (
      <div className="movies-list">
        <div className="movies-list__container">
            <img words alt="33 Words" />
            <p className="movies-list__container-title">33 слова о дизайне</p>
            <p className="movies-list__container-duration">1ч 17м</p>
            <button className="movies-list__save-button">Сохранить</button>
        </div>
        <button className="movies-list__more-button">Ещё</button>
      </div>
    );
  }
  
  export default MoviesCardList;
